import React from 'react'

import { Line } from 'react-chartjs-2';

export default function Smallchart(props) {

    return (
            <Line
                data={{
                    datasets: [{
                        labels: [1,2,3,4,5,6,7],
			            backgroundColor: 'rgb(0, 0, 255)',
			            borderColor: 'rgb(0, 0, 255)',
			            data: props.histData,
			            fill:false,
			            lineTension: 0,
			            pointRadius: 0
			        }
			      ]
                }}
                width={95}
                height={45}
            />
    )
}
